message:
/* Solo albums */Alex Salzman the music producer who co-produced Ace Frehley’s last studio album “Spaceman” in 2018, has confirmed(on his official Facebook page) Origins Vol 2, so I think it should be added since Aces producer has confirmed it, I put TBA for the year because while the album has been confirmed, since it’s early no release date has been confirmed. 

